// import logo from './logo.svg';
import './App.css';
import Navbar from './Navbar'
import Home from './pages/home'
import Game from './pages/game'
import Credits from './pages/credits'

function App() {
  let Component
  switch (window.location.pathname) {
    case '/':
      Component = <Home />;
      break
      case "/game":
        Component = <Game />;
        break
        case "/credits":
          Component =  <Credits />;
          break
  }
  return (<>
    <Navbar />
    {Component}
    </>
  )
}

export default App;
